div.script:
            $(".add-search .new-search").click( function(event){
                $(".ipt-search").css("display","block");
                $(".ipt-search input[type='text']").focus();
                event.stopPropagation();
            })
            $(".add-search").click( function(event){
                event.stopPropagation();
            })
            $(".ipt-search input").keydown( function(event){
                if(event.keyCode==13&&$(this).val()){
                	var href="/?s="+$(this).val();
                    window.location = href;
                }
            })
            $(document).click( function(){
                $(".ipt-search").css("display","none");
                $(".ipt-search input").val("");
            })

			$(".ipt-search .icon-s").click( function(){
				var temp = $(this).siblings("input").val();
				if(temp){
					window.location.href = "/?s="+temp;
				}
			})



$(document).ready( function(){
var timer = null;

var collapsedNavItems = [
	{lang: "ru-RU", selector: '#menu-item-20377'},
	{lang: "it-IT", selector: '#menu-item-20377'},
	{lang: "es-ES", selector: '#menu-item-20377'},
	{lang: "nl", selector: '#menu-item-20377'},
];

var currentTargetId = null;

function open(id){
    $('.new-more').addClass('open');
    $("#menu-item-20377").css("display","block");
    $(".hs-menu >ul >li").not("#menu-item-20377").css("pointer-events","none");
}

function close(id){
    $("#menu-item-20377").css('display','none');
    $('.new-more').removeClass('open');
    $(".hs-menu >ul >li").css("pointer-events","auto");
}

$('.new-more').unbind();

$(document).on('mouseover', '.new-more', function(e){
    clearTimeout(timer);
    currentTargetId = e.currentTarget.id;
    open(currentTargetId);
})

$(document).on('mouseout', '.new-more', function(e){
	clearTimeout(timer);

	timer = setTimeout(function(){
		currentTargetId = e.currentTarget.id;
		close(currentTargetId);
	}, 200)
})

var collapsedNavItemSelectors = jQuery.map(collapsedNavItems, function(it){
	return 'html[lang="'+it.lang+'"] '+it.selector;
}).join();

$(document).on('mouseover', collapsedNavItemSelectors, function(e){
    clearTimeout(timer);
    currentTargetId = e.currentTarget.id;
    open(currentTargetId);
})

$(document).on('mouseout', collapsedNavItemSelectors, function(e){
	clearTimeout(timer);
	timer = setTimeout(function(){
		currentTargetId = e.currentTarget.id;
		close(currentTargetId);
	}, 200)
}) 
})

script:
	function openwindow(url,name,iWidth,iHeight)
	{
		var url; //转向网页的地址;
		var name; //网页名称，可为空;
		var iWidth; //弹出窗口的宽度;
		var iHeight; //弹出窗口的高度;
//window.screen.height获得屏幕的高，window.screen.width获得屏幕的宽
		var iTop = (window.screen.height-30-iHeight)/2; //获得窗口的垂直位置;
		var iLeft = (window.screen.width-10-iWidth)/2; //获得窗口的水平位置;
		window.open(url,name,'height='+iHeight+',,innerHeight='+iHeight+',width='+iWidth+',innerWidth='+iWidth+',top='+iTop+',left='+iLeft+',toolbar=no,menubar=no,scrollbars=auto,resizeable=no,location=no,status=no');
	}

window.dataLayer = window.dataLayer || [];
function gtag() {
  dataLayer.push(arguments);
}
